import React from 'react';
import ReactDOM from 'react-dom/client';
import { useEffect } from 'react';

function App() {
    [width, setWidth] = useEffect(window.screen.width)
    [height, setHeight] = useEffect(window.screen.height)

    onChange = () => {
        setWidth(window.screen.width)
        setHeight(window.screen.height)
    }

    return <>
    <h1>Hello</h1>
    <p>Width : {width}</p>
    <p>Width : {height}</p>
    
    
    </>
}

export default App
